import React from 'react'

function Footer() {
    return (
        <>
            <footer>
                <p>2021 All rights are reserved  <i className="fab fa-instagram fa-2x"/><i className="fab fa-youtube fa-2x"/></p>
               
            </footer>
        </>
    )
}

export default Footer
